// Utility functions for filtering repeaters
function getRepeatersInRadius(centerLat, centerLng, radiusKm, repeaters = repeaterData) {
    return repeaters.filter(repeater => {
        const distance = calculateDistance(centerLat, centerLng, repeater.lat, repeater.lng);
        return distance <= radiusKm;
    });
}

function calculateDistance(lat1, lng1, lat2, lng2) {
    const R = 6371; // Earth's radius in kilometers
    const dLat = (lat2 - lat1) * Math.PI / 180;
    const dLng = (lng2 - lng1) * Math.PI / 180;
    const a = Math.sin(dLat/2) * Math.sin(dLat/2) +
              Math.cos(lat1 * Math.PI / 180) * Math.cos(lat2 * Math.PI / 180) *
              Math.sin(dLng/2) * Math.sin(dLng/2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
    return R * c;
}

function filterByBand(repeaters, band) {
    if (band === 'all') return repeaters;
    return repeaters.filter(repeater => repeater.band === band);
}

function filterByMode(repeaters, mode) {
    if (mode === 'all') return repeaters;
    return repeaters.filter(repeater => repeater.mode === mode);
}

function getAvailableBands() {
    const bands = [...new Set(repeaterData.map(r => r.band))];
    return bands.sort();
}

function getAvailableModes() {
    const modes = [...new Set(repeaterData.map(r => r.mode))];
    return modes.sort();
}

